import React from 'react';
import '../App.css';
import './ContributorSection.css';


function ContributorSection() {
  return (
    <div className='contributor'>
  <center>
    
  <div className='list2'>
  
  <p style = {{marginBottom : '5px', fontFamily : 'Trebuchet MS', fontSize: '20px'}}>Jeonghoon Seo</p> 
  <p style = {{marginBottom : '5px', fontFamily : 'Trebuchet MS'}}>12345@gmail.com</p>
  </div>
  

  <div className='list2'>
  
  <p style = {{marginBottom : '5px', fontFamily : 'Trebuchet MS', fontSize: '20px'}}>Jeonghyun Lee</p> 
  <p style = {{marginBottom : '5px', fontFamily : 'Trebuchet MS'}}>12345@gmail.com</p> 
  </div>

  <div className='list2'>
  
  <p style = {{marginBottom : '5px', fontFamily : 'Trebuchet MS', fontSize: '20px'}}>Jongyong Park</p> 
  <p style = {{marginBottom : '5px', fontFamily : 'Trebuchet MS'}}>12345@gmail.com</p>
  </div>

  <div className='list2'>
  
  <p style = {{marginBottom : '5px', fontFamily : 'Trebuchet MS', fontSize: '20px'}}>Jiyoon Kim</p> 
  <p style = {{marginBottom : '5px', fontFamily : 'Trebuchet MS'}}>12345@gmail.com</p>
  </div>
  </center>
  </div>

    
  );
}

export default ContributorSection;
